private void initUsers() {
  if (this.users != null) {
    return;
  }
  GetApplicationsRequestProtoOrBuilder p = viaProto ? proto : builder;
  List<String> usersList = p.getUsersList();
  this.users = new HashSet<String>();
  this.users.addAll(usersList);
}
